import React from 'react'

const ShowSeats = (props) => {

  return (
    <div>
      {
          allseats.map(
            (seat, index) => (
              <tr key={index}>
                <div className='side-by-side'>
                  <div className='p-1'></div>
                  {
                    props.checkBooked(sea)
                  }
                  <div className='p-1'></div>
                  {
                    isBooked(seat[1])
                  }
                  <div className='p-4'></div>
                  {
                    isBooked(seat[2])
                  }
                  <div className='p-1'></div>
                  {
                    isBooked(seat[3])
                  }
                </div>
                {/* <div className='p-1'></div> */}
              </tr>
            )
          )
        }
    </div>
  )
}

export default ShowSeats
